import { FaGithub, FaLinkedin, FaDocker, FaReact } from "react-icons/fa";
import {
	DiVisualstudio,
	DiGithubBadge,
	DiSass,
	DiStackoverflow,
	DiWordpress
} from "react-icons/di";
function HomePage() {
	return (
		<>
			<header>
				<h1>Sean Lyons</h1>
				<ul>
					<li>
						<FaGithub />
					</li>
					<li>
						<FaLinkedin />
					</li>
				</ul>
			</header>
			<main>
				<section className="technologies">
					<div className="icons">
						<DiVisualstudio />
						<FaDocker />
						<FaReact />
						<DiGithubBadge />
						<DiSass />
						<DiStackoverflow />
						<DiWordpress />
					</div>
				</section>
				<section className="skills-experience">
					<p>on the way</p>
				</section>
			</main>
			<footer></footer>
			<style jsx>{`
				@import url("https://fonts.googleapis.com/css?family=Abril+Fatface&display=swap");

				h1 {
					font-family: "Abril Fatface", sans-serif;
				}
			`}</style>
		</>
	);
}

export default HomePage;
